    public static func drawGdaxButton(bounds: CGRect = CGRect(x: 0, y: 0, width: 191, height: 56), original: Bool = true, hover: Bool = false, pressed: Bool = false) {
        //// General Declarations
        let context = UIGraphicsGetCurrentContext()!

        //// Color Declarations
        let highlightGradientColor = UIColor(red: 1.000, green: 1.000, blue: 1.000, alpha: 0.090)
        let highlightGradientColor2 = UIColor(red: 1.000, green: 1.000, blue: 1.000, alpha: 0.000)
        let shadow2Color = UIColor(red: 1.000, green: 1.000, blue: 1.000, alpha: 0.360)
        let logoWhite = UIColor(red: 1.000, green: 1.000, blue: 1.000, alpha: 1.000)
        let gdaxBackground = UIColor(red: 0.181, green: 0.244, blue: 0.315, alpha: 1.000)
        let gdaxLogoBackground = UIColor(red: 0.384, green: 0.626, blue: 0.832, alpha: 1.000)

        //// Gradient Declarations
        let highlightGradient = CGGradient(colorsSpace: nil, colors: [highlightGradientColor.cgColor, highlightGradientColor2.cgColor] as CFArray, locations: [0, 1])!

        //// Shadow Declarations
        let outerShadow = NSShadow()
        outerShadow.shadowColor = UIColor.black
        outerShadow.shadowOffset = CGSize(width: 0, height: 0)
        outerShadow.shadowBlurRadius = 0.5
        let innerStroke = NSShadow()
        innerStroke.shadowColor = shadow2Color
        innerStroke.shadowOffset = CGSize(width: 0, height: 0)
        innerStroke.shadowBlurRadius = 0.5

        if (original) {
            //// gdax
            context.saveGState()
            context.translateBy(x: bounds.minX + 95.5, y: bounds.minY + 28)

            context.setShadow(offset: outerShadow.shadowOffset, blur: outerShadow.shadowBlurRadius, color: (outerShadow.shadowColor as! UIColor).cgColor)
            context.beginTransparencyLayer(auxiliaryInfo: nil)


            //// gdaxBase Drawing
            let gdaxBasePath = UIBezierPath(roundedRect: CGRect(x: -88.5, y: -21, width: 177, height: 42), cornerRadius: 5)
            gdaxBackground.setFill()
            gdaxBasePath.fill()


            //// gdaxHighlight Drawing
